Most designs will allocated it always but since this will be used about 1 in 10000 apps.
I figure minimize the impact and only allocate on first use. Of those that use this most will never remove the modifier. 
I could see some one stupidly adding and removing on status (on touch down) but then you want to minimize the memory churn. 

Overall I just gave up at that point and thought it is not worth it to be too complex in this area. 
