In an app somewhere 
e.g. in onCreate 
```java
       mConstraintLayout.addValueModifier((width, height, id1, view, params) -> {
            if (id1 == R.id.myView) {
                params.width = width/3;
                return true;
            }
            return false;
        });
```
or in a subclass 

```java
        setOnTouchListener((view, e)->{
            mPosX = (int)e.getX();
            mPosY = (int)e.getY();
            return true;
        });
        addValueModifier((width, height, id1, view, params) -> {
            if (id1 == R.id.drag) {
                params.leftMargin =mPosX-params.width/2;
                params.topMargin =mPosY-params.height/2;
                if (Build.VERSION.SDK_INT >= Build.VERSION_CODES.JELLY_BEAN_MR1) {
                    params.setMarginStart(mPosX);
                }
                return true;
            }
            return false;
        });
```
